measurements.description:
One flower on one 40-cm strong upright inflorescence;
 sepals orbicular, white, light green basally, lined and heavily spotted burgundy along veins;
 petals slightly twisted, obovate, light chartreuse, heavily overlaid cordovan superior surface,
 spotted basally inferior surface, overlaid cordovan apically;
 pouch straight, light green, heavily overlaid cordovan, spotted cordovan interior;
 staminode creamy yellow, umbo bright yellow;
 substance medium-firm; texture waxy.
